// src/components/HomePage.js
import React from 'react';
import { Button } from 'react-bootstrap';
import mapBg   from 'C:/Users/Dell/Desktop/miniproject/frontend/public/assets/uber2.png';
import carImg  from 'C:\Users\Dell\Desktop\miniproject\frontend\public\assets\car.png';
import './HomePage.css';

const HomePage = ({ onAnalyze }) => (
  <div className="homepage-hero">
    {/* fullâ€‘width map background */}
    <img src={mapBg} alt="Map background" className="hero-bg" />

    {/* positioned car image */}
    <img src={carImg} alt="Car" className="hero-car" />

    {/* overlay content */}
    <div className="hero-content">
      <h1>Uber Data Analysis</h1>
      <Button variant="light" size="sm" onClick={onAnalyze}>
        Analysis
      </Button>
    </div>
  </div>
);

export default HomePage;
